BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Ratings" (
	"Buyer_Email"	TEXT,
	"Seller_Email"	TEXT,
	"Date"	TEXT,
	"Rating"	INTEGER,
	"Rating_Desc"	TEXT
);
CREATE TABLE IF NOT EXISTS "Reviews" (
	"Buyer_Email"	TEXT,
	"Seller_Email"	TEXT,
	"Listing_ID"	INTEGER,
	"Review_Desc"	TEXT
);
CREATE TABLE IF NOT EXISTS "Address" (
	"address_id"	TEXT,
	"zipcode"	INTEGER,
	"street_num"	INTEGER,
	"street_name"	TEXT,
	PRIMARY KEY("address_id")
);
CREATE TABLE IF NOT EXISTS "Zipcode_Info" (
	"zipcode"	INTEGER,
	"city"	TEXT,
	"state_id"	INTEGER,
	"population"	INTEGER,
	"density"	INTEGER,
	"county_name"	TEXT,
	"timezone"	TEXT,
	PRIMARY KEY("state_id","zipcode")
);
CREATE TABLE IF NOT EXISTS "Users" (
	"email"	TEXT,
	"password"	TEXT,
	PRIMARY KEY("email")
);
CREATE TABLE IF NOT EXISTS "Buyers" (
	"email"	TEXT,
	"first_name"	TEXT,
	"last_name"	TEXT,
	"gender"	TEXT,
	"age"	NUMERIC,
	"home_address_id"	TEXT,
	"billing_address_id"	TEXT,
	PRIMARY KEY("email")
);
CREATE TABLE IF NOT EXISTS "Credit_Cards" (
	"credit_card_num"	TEXT,
	"card_code"	INTEGER,
	"expire_month"	NUMERIC,
	"expire_year"	INTEGER,
	"card_type"	TEXT,
	"Owner_email"	TEXT,
	PRIMARY KEY("credit_card_num")
);
CREATE TABLE IF NOT EXISTS "Sellers" (
	"email"	TEXT,
	"routing_number"	TEXT,
	"account_number"	INTEGER,
	"balance"	INTEGER,
	PRIMARY KEY("email")
);
CREATE TABLE IF NOT EXISTS "Local_Vendors" (
	"Email"	TEXT,
	"BusinessName"	TEXT,
	"BusinessAddressID"	TEXT,
	"CustomerServiceNumber"	TEXT,
	PRIMARY KEY("Email")
);
CREATE TABLE IF NOT EXISTS "Categories" (
	"parent_category"	TEXT,
	"category_name"	TEXT,
	PRIMARY KEY("category_name")
);
CREATE TABLE IF NOT EXISTS "Product_Listing" (
	"Seller_Email"	TEXT,
	"Listing_ID"	INTEGER UNIQUE,
	"Category"	TEXT,
	"Title"	TEXT,
	"Product_Name"	TEXT,
	"Product_Description"	TEXT,
	"Price"	TEXT,
	"Quantity"	INTEGER,
	PRIMARY KEY("Seller_Email","Listing_ID")
);
CREATE TABLE IF NOT EXISTS "Orders" (
	"Transaction_ID"	INTEGER,
	"Seller_Email"	TEXT,
	"Listing_ID"	INTEGER,
	"Buyer_Email"	TEXT,
	"Date"	TEXT,
	"Quantity"	INTEGER,
	"Payment"	INTEGER,
	PRIMARY KEY("Transaction_ID")
);
COMMIT;
